import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import User from './myComponent/User/User';
import Header from './myComponent/Header/Header';
import fakeData from './fakeData';

function App() {
  const first4 = fakeData.slice(0,4);
  const second4 = fakeData.slice(0,4);
  const [users,setUsers] = useState(first4);
  return (
    <div>
      <Header></Header>
      {
        users.slice(0,4).map(user => <User user={user}></User>)
      }
      {
        setUsers = () => {setUsers(users + second4);},
        users.slice(4,8).map(user => <User user={user}></User>)
      }
      {/* {
        users.slice(8,12).map(user => <User user={user}></User>)
      }
      {
        users.slice(12,16).map(user => <User user={user}></User>)
      } */}
    </div>
  );
}

export default App;
